@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM rdf:type owl:Class .
atm:Account rdf:type owl:Class .
atm:Bank rdf:type owl:Class .
atm:CashCard rdf:type owl:Class .
atm:Customer rdf:type owl:Class .

atm:belongsToBank rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:cardIssuedBy rdf:type owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:hasAccount rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:ownsCard rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:ValidCashCard rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty atm:ownsCard ;
                          owl:someValuesFrom atm:CashCard ] .

atm:ValidPassword rdf:type owl:Class .

atm:ProblemWithAccount rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty atm:hasAccount ;
                          owl:someValuesFrom atm:Account ] .

atm:BankMessage rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty atm:belongsToBank ;
                          owl:someValuesFrom atm:Bank ] .

atm:ATMMessage rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty atm:belongsToBank ;
                          owl:someValuesFrom atm:ATM ] .

atm:ValidCashCardAndValidPassword rdf:type owl:Class ;
    owl:intersectionOf ( atm:ValidCashCard atm:ValidPassword ) .

atm:ValidCashCardAndValidPasswordButProblemWithAccount rdf:type owl:Class ;
    owl:intersectionOf ( atm:ValidCashCardAndValidPassword atm:ProblemWithAccount ) .

atm:BankSendsMessage rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty atm:belongsToBank ;
                          owl:someValuesFrom atm:BankMessage ] .

atm:ATMReceivesMessage rdf:type owl:Class ;
    owl:equivalentClass [ rdf:type owl:Restriction ;
                          owl:onProperty atm:belongsToBank ;
                          owl:someValuesFrom atm:ATMMessage ] .

atm:BankSendsMessageToATM rdf:type owl:Class ;
    owl:intersectionOf ( atm:BankSendsMessage atm:ATMReceivesMessage ) .

atm:ValidCashCardAndValidPasswordButProblemWithAccount rdfs:subClassOf atm:BankSendsMessageToATM .
